kE("common/heap.effekt","module heap\nimport resizable_array\n\n/// Resizable 2-ary min-heap, backed by a resizable array\n/// `cmp` defines the ordering of elements\nrecord Heap[T](rawContents: ResizableArray[T], cmp: (T, T) \x3d\x3e Ordering at {})\n\n/// Make a new Heap with the given comparison operation\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}) \x3d \n  Heap[T](resizableArray(), cmp)\n\n/// Make a new Heap with the given comparison operation and initial capacity\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}, capacity: Int) \x3d \n  Heap[T](resizableArray(capacity), cmp)\n\nnamespace internal {\n  def left(idx: Int) \x3d 2 * idx + 1\n  def right(idx: Int) \x3d 2 * idx + 2\n  def parent(idx: Int) \x3d (idx - 1) / 2\n\n  def bubbleUp[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n    arr.boundsCheck(idx) // idx \x3e parent(idx), parent(parent(idx)) etc\n\n    def go(idx: Int): Unit \x3d {\n      if (idx \x3e 0 and (heap.cmp)(arr.unsafeGet(parent(idx)), arr.unsafeGet(idx)) is Greater()) {\n        arr.unsafeSwap(parent(idx), idx)\n        go(parent(idx))\n      }\n    }\n    go(idx)\n  }\n  def sinkDown[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n\n    def infixLt(x: A, y: A) \x3d {\n      if ((heap.cmp)(x,y) is Less()) { true } else { false }\n    }\n    \n    def go(idx: Int): Unit \x3d {\n      if (right(idx) \x3c arr.size) {\n        val v \x3d arr.unsafeGet(idx)\n        val l \x3d arr.unsafeGet(left(idx))\n        val r \x3d arr.unsafeGet(right(idx))\n        if (l \x3c v \x26\x26 r \x3c v) {\n          // swap with the smaller one\n          if (l \x3c r) {\n            arr.unsafeSwap(left(idx), idx)\n            go(left(idx))\n          } else {\n            arr.unsafeSwap(right(idx), idx)\n            go(right(idx))\n          }\n        } else if (l \x3c v) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        } else if (r \x3c v) {\n          arr.unsafeSwap(right(idx), idx)\n          go(right(idx))\n        }\n      } else if (left(idx) \x3c arr.size) {\n        if (arr.unsafeGet(left(idx)) \x3c arr.unsafeGet(idx)) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        }\n      } // else: we are at the bottom\n    }\n    go(idx)\n  }\n}\n\n/// Insert value into heap\n///\n/// O(log n) worst case if capacity suffices, O(1) average\ndef insert[T](heap: Heap[T], value: T): Unit \x3d {\n  with on[OutOfBounds].panic();\n  val idx \x3d heap.rawContents.add(value)\n  internal::bubbleUp(heap, idx)\n}\n\n/// find and return (but not remove) the minimal element in this heap\n///\n/// O(1)\ndef findMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  heap.rawContents.get(0)\n}\n\n/// find and remove the minimal element in this heap\n///\n/// O(log n)\ndef deleteMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  val res \x3d heap.rawContents.get(0)\n  heap.rawContents.unsafeSet(0, heap.rawContents.popRight())\n  internal::sinkDown(heap, 0)\n  res\n}\n\n/// Number of elements in the heap\n///\n/// O(1)\ndef size[T](heap: Heap[T]): Int \x3d {\n  heap.rawContents.size\n}");
kE("common/exception.effekt",'module exception\n\nimport effekt\n\n// Exceptions\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\ninterface Exception[E] {\n  def raise(exception: E, msg: String): Nothing\n}\n\ndef raise[A, E](exception: E, msg: String): A / Exception[E] \x3d\n  do raise(exception, msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect a non-empty\n * container (e.g. option or list).\n */\nrecord MissingValue()\n\ndef missingValue(): Nothing / Exception[MissingValue] \x3d\n  do raise(MissingValue(), "Missing value.")\n\n/**\n * Used as a type for `Exception` in functions where an index can be out of bounds.\n */\nrecord OutOfBounds()\n\n/**\n * Unexpected runtime exceptions that can be caught.\n */\nrecord RuntimeError()\n\ndef raise[A](msg: String): A / Exception[RuntimeError] \x3d\n  do raise(RuntimeError(), msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect the input\n * to be formatted in a specific way.\n */\nrecord WrongFormat()\n\ndef wrongFormat(): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), "Wrong format.")\n\ndef wrongFormat(msg: String): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), msg)\n\n\n/**\n * A fatal runtime error that cannot be caught\n */\nextern io def panic(msg: String): Nothing \x3d\n  js "(function() { throw ${msg} })()"\n  chez "(raise ${msg})"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_io_println(%Pos ${msg})\n    call void @exit(i32 1)\n    ret %Pos zeroinitializer ; Unit\n  !!!MULTILINEMARKER!!!\n\n\n// Exception Handlers\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\n\n/**\n * Converts exceptions of (static) type E to an uncatchable panic that aborts the program\n */\ndef panicOn[E, T] { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d panic(msg) }\n\n/**\n * Reports exceptions of (static) type E to the console\n */\ndef report[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d println(msg) }\n\n/**\n * Ignores exceptions of (static) type E\n */\ndef ignore[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d () }\n\n/**\n * Use the default value to handle the exception of type E\n */\ndef default[E, T] { default: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d default() }\n\n/**\n * Runs the finalizer and rethrows E\n */\ndef finalize[E, T] { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  try { val res \x3d prog(); finalizer(); res } with Exception[E] {\n    def raise(exception: E, msg: String) \x3d { finalizer(); do raise(exception, msg) }\n  }\n\n/**\n * A proxy value to enable partial type applications, such as:\n *\n * ```\n * with on[MissingValue].ignore; ...\n * ```\n */\nrecord on[E]()\n\ndef ignore[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  ignore[E] {prog}\n\ndef default[E, T](proxy: on[E]) { d: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  default[E, T] {d} {prog}\n\ndef panic[E, T](proxy: on[E]) { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  panicOn[E, T] {prog}\n\ndef report[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  report[E] {prog}\n\ndef finalize[E, T](proxy: on[E]) { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  finalize[E, T] {finalizer} {prog}');
kE("common/queue.effekt","module queue\n\nimport array\n\n/// Mutable, automatically resizing queue.\ninterface Queue[T] {\n  def empty?(): Bool\n\n  def popFront(): Option[T]\n\n  def popBack(): Option[T]\n\n  def peekFront(): Option[T]\n\n  def peekBack(): Option[T]\n\n  def pushFront(el: T): Unit\n\n  def pushBack(el: T): Unit\n}\n\n\ndef emptyQueue[T](): Queue[T] at {global} \x3d\n  emptyQueue[T](64)\n\ndef emptyQueue[T](initialCapacity: Int): Queue[T] at {global} \x3d {\n\n  val contents \x3d ref(array[Option[T]](initialCapacity, None()))\n  val head \x3d ref(0)\n  val tail \x3d ref(0)\n  val size \x3d ref(0)\n  val capacity \x3d ref(initialCapacity)\n\n  def remove(arr: Array[Option[T]], index: Int): Option[T] \x3d {\n    with on[OutOfBounds].default { None() }\n    val value \x3d arr.get(index)\n    arr.set(index, None())\n    value\n  }\n\n  def nonEmpty[T] { p: \x3d\x3e Option[T] / Exception[OutOfBounds] }: Option[T] \x3d\n    if (size.get \x3c\x3d 0) None() else on[OutOfBounds].default { None() } { p() }\n\n  // Exponential back-off\n  def resizeTo(requiredSize: Int): Unit \x3d\n    if (requiredSize \x3c\x3d capacity.get) () else {\n      with on[OutOfBounds].ignore // should not happen\n\n      val oldSize \x3d capacity.get\n      val newSize \x3d capacity.get * 2\n      val oldContents \x3d contents.get\n      val newContents \x3d array::allocate[Option[T]](newSize)\n\n      if (head.get \x3c tail.get) {\n        // The queue does not wrap around; direct copy is possible.\n        copy(oldContents, head.get, newContents, 0, size.get) // changed tail to size\n      } else if (size.get \x3e 0) {\n        // The queue wraps around; copy in two segments.\n        copy(oldContents, head.get, newContents, 0, oldSize - head.get) // changed oldSize to oldSize - head\n        copy(oldContents, 0, newContents, oldSize - head.get, tail.get) // changed oldSize - head to oldSize - head\n      }\n\n      contents.set(newContents)\n      capacity.set(newSize)\n      head.set(0)\n      tail.set(oldSize)\n    }\n\n  def queue \x3d new Queue[T] {\n    def empty?() \x3d size.get \x3c\x3d 0\n\n    def popFront() \x3d\n      nonEmpty {\n        val result \x3d contents.get.remove(head.get)\n        head.set(mod(head.get + 1, capacity.get))\n        size.set(size.get - 1)\n        result\n      }\n\n    def popBack() \x3d\n      nonEmpty {\n        tail.set(mod(tail.get - 1 + capacity.get, capacity.get))\n        val result \x3d contents.get.remove(tail.get)\n        size.set(size.get - 1)\n        result\n      }\n\n    def peekFront() \x3d nonEmpty { contents.get.get(head.get) }\n\n    def peekBack() \x3d nonEmpty { contents.get.get(tail.get) }\n\n    def pushFront(el: T) \x3d {\n      resizeTo(size.get + 1)\n      head.set(mod(head.get - 1 + capacity.get, capacity.get))\n      size.set(size.get + 1)\n      contents.get.unsafeSet(head.get, Some(el))\n    }\n\n    def pushBack(el: T) \x3d {\n      resizeTo(size.get + 1)\n      contents.get.unsafeSet(tail.get, Some(el))\n      size.set(size.get + 1)\n      tail.set(mod(tail.get + 1, capacity.get))\n    }\n  }\n  queue\n}\n\nnamespace examples {\n  def main() \x3d {\n    // queue with initial capacity 4\n    def b \x3d emptyQueue[Int](4)\n    println(b.empty?)\n    b.pushFront(1)\n    b.pushBack(2)\n    b.pushFront(3)\n    b.pushBack(4)\n    // this will cause resizing:\n    b.pushBack(5)\n    b.pushBack(6)\n    b.pushBack(7)\n    b.pushBack(8)\n    // and again:\n    b.pushBack(9)\n\n    println(b.empty?)\n    println(b.popFront()) // Some(3)\n    println(b.popFront()) // Some(1)\n    println(b.popFront()) // Some(2)\n    println(b.popFront()) // Some(4)\n    println(b.popFront()) // Some(5)\n    println(b.popFront()) // Some(6)\n    println(b.popFront()) // Some(7)\n    println(b.popFront()) // Some(8)\n    println(b.popFront()) // Some(9)\n    println(b.popFront()) // None()\n  }\n}\n");
kE("common/test.effekt",'import tty\nimport process\nimport bench\n\ninterface Assertion {\n  def assert(condition: Bool, msg: String): Unit\n}\n\ndef assertTrue(condition: Bool, msg: String) \x3d\n  do assert(condition, msg)\n\ndef assertTrue(condition: Bool) \x3d\n  do assert(condition, "Assertion failed")\n\ndef assertFalse(condition: Bool, msg: String) \x3d\n  do assert(not(condition), msg)\n\ndef assertFalse(condition: Bool) \x3d\n  do assert(not(condition), "Assertion failed")\n\ndef assert(obtained: Int, expected: Int, msg: String): Unit / Assertion \x3d\n  assertEqual(obtained, expected, msg) { (x, y) \x3d\x3e x \x3d\x3d y }\n\ndef assert(obtained: Bool, expected: Bool, msg: String): Unit / Assertion \x3d\n  assertEqual(obtained, expected, msg) { (x, y) \x3d\x3e x \x3d\x3d y }\n\ndef assert(obtained: Char, expected: Char, msg: String): Unit / Assertion \x3d\n  assertEqual(obtained, expected, msg) { (x, y) \x3d\x3e x \x3d\x3d y }\n\ndef assert(obtained: String, expected: String, msg: String): Unit / Assertion \x3d\n  assertEqual(obtained, expected, msg) { (x, y) \x3d\x3e x \x3d\x3d y }\n\ndef assert(obtained: Int, expected: Int): Unit / { Assertion, Formatted } \x3d\n  assertEqual(obtained, expected) { (x, y) \x3d\x3e x \x3d\x3d y } { x \x3d\x3e show(x) }\n\ndef assert(obtained: Bool, expected: Bool): Unit / { Assertion, Formatted } \x3d\n  assertEqual(obtained, expected) { (x, y) \x3d\x3e x \x3d\x3d y } { x \x3d\x3e show(x) }\n\ndef assert(obtained: Char, expected: Char): Unit / { Assertion, Formatted } \x3d\n  assertEqual(obtained, expected) { (x, y) \x3d\x3e x \x3d\x3d y } { x \x3d\x3e show(x) }\n\ndef assert(obtained: String, expected: String): Unit / { Assertion, Formatted } \x3d\n  assertEqual(obtained, expected) { (x, y) \x3d\x3e x \x3d\x3d y } { x \x3d\x3e show(x) }\n\ndef assertEqual[A](obtained: A, expected: A, msg: String): Unit / Assertion \x3d\n  assertEqual(obtained, expected, msg) { (x, y) \x3d\x3e x.equals(y) }\n\ndef assertEqual[A](obtained: A, expected: A): Unit / { Assertion, Formatted } \x3d\n  assertEqual(obtained, expected) { (x, y) \x3d\x3e x.equals(y) } { x \x3d\x3e x.genericShow }\n\ndef assertEqual[A](obtained: A, expected: A, msg: String) { equals: (A, A) \x3d\x3e Bool }: Unit / Assertion \x3d\n  do assert(equals(obtained, expected), msg)\n\ndef assertEqual[A](obtained: A, expected: A) { equals: (A, A) \x3d\x3e Bool } { show: A \x3d\x3e String }: Unit / { Assertion, Formatted } \x3d\n  do assert(equals(obtained, expected), Formatted::tryEmit(Escape::RESET) ++ "Expected: ".dim ++ show(expected).green ++ "\\n  Obtained: ".dim ++ show(obtained).red)\n  // NOTE:                              ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^\n  //             Here\'s an accidental capture! Can we prevent this somehow nicely?\n\n\ninterface Test {\n  def success(name: String, duration: Int): Unit\n  def failure(name: String, msg: String, duration: Int): Unit\n}\n\n/// Runs the `body` as a test under the given `name`\n/// See `suite` for examples.\ndef test(name: String) { body: \x3d\x3e Unit / Assertion } \x3d {\n  val startTime \x3d bench::relativeTimestamp()\n  try {\n    body()\n    val duration \x3d Duration::diff(startTime, bench::relativeTimestamp())\n    do success(name, duration)\n  } with Assertion {\n    def assert(condition, msg) \x3d\n      if (condition) resume(())\n      else {\n        val duration \x3d Duration::diff(startTime, bench::relativeTimestamp())\n        do failure(name, msg, duration)\n      }\n  }\n}\n\n/// Run a test suite with a given `name`.\n/// - If `printTimes` is `true` (or missing), prints out time in milliseconds.\n/// - Formats automatically using ANSI escapes.\n/// - Returns `true` if all tests succeed, otherwise returns `false`. If you want to exit the program on failure, see `mainSuite`.\n///\n/// Example:\n/// ```effekt\n/// suite("My Tests") {\n///   test("1 + 1 \x3d\x3d 2") {\n///     assertEqual(1 + 1, 2)\n///   }\n/// }\n/// ```\ndef suite(name: String, printTimes: Bool) { body: \x3d\x3e Unit / { Test, Formatted } }: Bool / {} \x3d {\n  with Formatted::formatting;\n\n  def ms(duration: Int): String / Formatted \x3d\n    if (printTimes) {\n      " " ++ ("[" ++ bench::formatMs(duration) ++ "]").dim\n    } else {\n      ""\n    }\n\n  def dimWhenZeroElse(s: String, n: Int) { colorIfNonZero: String \x3d\x3e String / Formatted } \x3d\n    if (n \x3d\x3d 0) { dim(s) }\n    else { colorIfNonZero(s) }\n\n  var failed \x3d 0\n  var passed \x3d 0\n\n  // 1) Print the name of the test\n  println(name.bold)\n\n  // 2) Run the tests, timing them\n  val totalDuration \x3d timed {\n    try { body() } with Test {\n      // 2a) Handle a passing test on success\n      def success(name, duration) \x3d {\n        passed \x3d passed + 1\n        println("\u2713".green ++ " " ++ name ++ duration.ms)\n        resume(())\n      }\n\n      // 2b) Handle a failing test on failure, additionally printing its message\n      def failure(name, msg, duration) \x3d {\n        failed \x3d failed + 1\n        println("\u2715".red ++ " " ++ name ++ duration.ms)\n        println("  " ++ msg.red)\n        resume(())\n      }\n    }\n  }\n\n  // 3) Format the test results\n  println("")\n  println(" " ++ (passed.show ++ " pass").dimWhenZeroElse(passed) { green })\n  println(" " ++ (failed.show ++ " fail").dimWhenZeroElse(failed) { red })\n  println(" " ++ (passed + failed).show ++ " tests total" ++ totalDuration.ms)\n\n  // 4) Return true if all tests succeeded, otherwise false\n  return failed \x3d\x3d 0\n}\n\n/// See `suite` above.\ndef suite(name: String) { body: \x3d\x3e Unit / { Test, Formatted } }: Bool / {} \x3d\n  suite(name, true) { body }\n\n/// Use as `def main() \x3d mainSuite("...") { ... }`\n/// Recommended for standalone test files ran by CI.\n///\n/// Exits after running all tests:\n/// - if all tests succeed, exits the program with success (exit code 0)\n/// - otherwise exits the program with failure (exit code 1)\ndef mainSuite(name: String) { body: \x3d\x3e Unit / { Test, Formatted } }: Unit \x3d {\n  val result \x3d suite(name, true) { body }\n  val exitCode \x3d if (result) 0 else 1\n  exit(exitCode)\n}\n');
kE("common/args.effekt",'module args\n\nextern io def commandLineArgs(): List[String] \x3d\n  js { js::commandLineArgs() }\n  chez { chez::commandLineArgs() }\n  llvm { llvm::commandLineArgs() }\n  vm { Nil() }\n\nnamespace js {\n  extern type Args // \x3d Array[String]\n\n  extern io def nativeArgs(): Args \x3d js "process.argv.slice(1)"\n\n  extern io def argCount(args: Args): Int \x3d js "${args}.length"\n\n  extern io def argument(args: Args, i: Int): String \x3d js "${args}[${i}]"\n\n  def commandLineArgs(): List[String] \x3d {\n    def toList(args: Args, start: Int, acc: List[String]): List[String] \x3d\n      if (start \x3c 1) { acc }\n      else args.toList(start - 1, Cons(args.argument(start), acc))\n\n    val args \x3d nativeArgs()\n    args.toList(args.argCount - 1, Nil())\n  }\n}\n\nnamespace chez {\n  extern type Args // \x3d CSList[String]\n\n  extern io def nativeArgs(): Args \x3d\n    chez "(cdr (command-line))"\n\n  extern pure def isEmpty(l: Args): Bool \x3d\n    chez "(null? ${l})"\n\n  extern pure def head(l: Args): String \x3d\n    chez "(car ${l})"\n\n  extern pure def tail(l: Args): Args \x3d\n    chez "(cdr ${l})"\n\n  def toList(l: Args): List[String] \x3d\n    if (l.isEmpty) Nil() else Cons(l.head, l.tail.toList)\n\n  def commandLineArgs(): List[String] \x3d nativeArgs().toList\n}\n\nnamespace llvm {\n  extern io def argCount(): Int \x3d\n    llvm !!!MULTILINEMARKER!!!\n      %c \x3d call %Int @c_get_argc()\n      ret %Int %c\n    !!!MULTILINEMARKER!!!\n\n  extern io def argument(i: Int): String \x3d\n    llvm !!!MULTILINEMARKER!!!\n      %s \x3d call %Pos @c_get_arg(%Int ${i})\n      ret %Pos %s\n    !!!MULTILINEMARKER!!!\n\n  def commandLineArgs(): List[String] \x3d {\n    def toList(start: Int, acc: List[String]): List[String] \x3d\n      if (start \x3c 1) { acc }\n      else toList(start - 1, Cons(argument(start), acc))\n\n    toList(argCount() - 1, Nil())\n  }\n}\n');
